import Icons from "../../Components/Icons/icons";
import { Background, ButtonWithGlyphIcon, FullScreenLoader, NavBar } from "../../Components/index";
import InputField from "../../Components/InputField/InputField";
import "./LandingPage.scss"
function LandingPage() {
  const navigate = useNavigate();
  const [isLoading, setIsLoading] = useState(false);
  const [usearchInput, setSearchInput] = useState("");



  if (isLoading) {
    return <FullScreenLoader showLoader={isLoading} />;
  }

  return (
    <>
      <Background>
        <Box className="landing-page-body">
          <InputField
            inputLabel="Enter Image Url"
            placeholder="start typing"
            value={searchInput}
            onChange={(e) => {
              setSearchInput(e.target.value);
            }}
            autoFocus
          />
        </Box>
      </Background>
    </>
  );
}

export default LandingPage;
